import News from './component/News';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";

export class App extends Component {

  render() {
    return (
      <>
        <Router>
          <Navbar />
          <Switch>



            <Route path="/"> <News pageSize={5} country="us" category="general" /> </Route>


          </Switch> 
        </Router>
      </>
    )
  }
}


export default App
